// components/Home.js

import React from 'react';

const Home = () => {
  return (
    <div style={{ backgroundColor: '#f2f2f2', padding: '20px' }}>
      <h1>Welcome to My Portfolio</h1>
      <p>Here, you can showcase your work and skills.</p>
    </div>
  );
};

export default Home;
